 # Release Notes for the MultiPortalCrane
 
 ## Version 16.1
 <h3 style="color:red;">Attention: The CranesAndMore library was restructured, so upon updating to this version you will need to adjust models that utilize this library.</h3>
 
 * From version 16.1 of this library and onward the MultiPortalCrane object has only a single vehicle driving on it's tracks, the portal
 <br/> 
 * The trolley and the hook displayed on the portal are modeled as animatable objects
 <br/> 
 * Calls directed to these objects such as
 <br/> <table><tr><td><pre>MyPortal.hook.cont</pre></td></tr></table> 
 now have to be redirected to the portal instead as in
 <br/> <table><tr><td><pre>MyPortal.cont</pre></td></tr></table> <br/> 
 * The control tab has been removed from the MultiPortalCran, collisions are detected via the collisionctrl method of the portal and a debugger opens up upon detection
 <br/> 
 * The trolley now does have a default height
 <br/> 
 * Failure profiles are the same for the portal, trolley and the hook, e.g. they share the failure profile that is configured for the portal
 <br/> 
 *  The methods **movePortalToPositionAbs**, **moveTo** and **_moveTo** have been removed. Instead of **moveTo** or **_moveTo**  the method **movePortalTo** should be utilized, in case that the portal and trolley should approach a position defined relative to the MultiPortalCrane with the option to also move the hook. Instead of **movePortalToPositionAbs** the method **moveToCranePosition** should be called.  Lastly instead of the method **moveToPosition** the method **moveToParentPosition** should be called. The methods **moveToPosition** and **moveToPositionAbs** will be removed in subsequent releases. Another important aspect to keep in mind is that these methods expect now two arguments, the x and y position that should be approached in the respective frame of reference.
 

